import React, {Component} from 'react';
import Accordion from '@material-ui/core/Accordion';
import AccordionDetails from '@material-ui/core/AccordionDetails';
import AccordionSummary from '@material-ui/core/AccordionSummary';
import AccordionActions from '@material-ui/core/AccordionActions';
import Typography from '@material-ui/core/Typography';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import Chip from '@material-ui/core/Chip';
import Button from '@material-ui/core/Button';
import Divider from '@material-ui/core/Divider';


//use the cip array to show Apps on a tablet
export default class Mani extends Component {
	constructor(props){
		super(props)
		this.state = {
			assetInfo : this.props.data

		}
	}

	render(){
		console.log(this)
		const { assetInfo : { id=null, gps=null }} = this.state
		console.log('LOG:', id,gps)
		return(
			<div>
			<Accordion defaultExpanded>
          <AccordionSummary
            expandIcon={<ExpandMoreIcon />}
            aria-controls="panel1c-content"
            id="panel1c-header"
          >
            <div >
              <Typography >Location</Typography>
            </div>
            <div >
              <Typography >Select trip destination</Typography>
            </div>
          </AccordionSummary>
          <AccordionDetails>
            <div  />
            <div >
              <Chip label="Barbados" onDelete={() => {}} />
            </div>
            <div >
              <Typography variant="caption">
                Select your destination of choice
                <br />
                <a href="#secondary-heading-and-columns" >
                  Learn more
                </a>
              </Typography>
            </div>
          </AccordionDetails>
          <Divider />
          <AccordionActions>
            <Button size="small">Cancel</Button>
            <Button size="small" color="primary">
              Save
            </Button>
          </AccordionActions>
        </Accordion>
			</div>
			)
	}
}
